#include <iostream>
#include <vector>

using namespace std;

class Solution {
   public:
    /**
    * Kadane's Algorithm:
    * 
    * 1. If including current element makes the current sum greater, add it. Otherwise, start new sum from this place.
    * 2. Update the global max sum appropriately.
    * 
    * @param A Input array containing the values.
    * @return int Returns the max sum subarray calculated circularly.
    */
    int maxSubarraySumCircular(vector<int> &A) {
        int n = A.size();
        if (n == 0)
            return 0;
        int maxSoFar = A[0], minSoFar = A[0], maxSum = A[0], minSum = A[0], totalSum = A[0];
        for (int i = 1; i < n; ++i) {
            maxSoFar = max(maxSoFar + A[i], A[i]);
            maxSum = max(maxSum, maxSoFar);
            minSoFar = min(A[i], minSoFar + A[i]);
            minSum = min(minSum, minSoFar);
            totalSum += A[i];
        }
        if (totalSum == minSum)
            return maxSum;
        else
            return max(totalSum - minSum, maxSum);
    }
};

